import './App.css';

function App() {
  return (

    <div className="App">
      <User name="Max" age={24} email="max@gmail.com"/>
      <User name="Make" age={29} email="make@gmail.com"/>
      <User name="Jay" age={23} email="jay@gmail.com"/>
    </div>
  );
}

const User = (props) => {
  return(
  <div>
    <h1>{props.name}</h1>
    <h2>{props.age}</h2>
    <h3>{props.email}</h3>
  </div>
  );
}


export default App;
